import React from 'react'
import { Slide } from 'react-slideshow-image'
import 'react-slideshow-image/dist/styles.css'




function Header() {

    const slideImages = [
        'images/slide_2.jpg',
        'images/slide_3.jpg',
        'images/slide_4.jpg'
    ];




    const showSlide = n => {
        
        let slides = document.getElementsByClassName("carousel-item");
        let dots = document.getElementsByClassName("indicators");

        if (n > slides.length) { slideIndex = 1 }
        if (n < 1) { slideIndex = slides.length }

        for ( let i = 0; i < slides.length; i++) {
            slides[i].classList.remove("d-none");
        }
        for (let i = 0; i < dots.length; i++) {
            dots[i].classList.remove('active');
        }

        slides[slideIndex - 1].classList.add('d-block');
        dots[slideIndex - 1].classList.add('active');
    }

    var slideIndex = 1;


    const plusSlides = n => {

        showSlide(slideIndex += n);
        
    }

    const currentSlide = n => {

        showSlide(slideIndex = n);
    }


    return (
        <div>
            <nav id="home" className="navbar navbar-expand navbar-dark bg-primary">
                <div className="container-fluid">
                    <a className="navbar-brand " href="#home"><span className="text-warning fs-4"><b>Holi</b></span>day</a>
                <button className="navbar-toggler" type="button">
                    <span className="navbar-toggler-icon"></span>
                </button>
                    <div className="collapse navbar-collapse ">
                        <form className="d-flex position-absolute top-50 start-50 translate-middle myInput">
                            <input className="form-control me-2 " type="search" placeholder="Search" aria-label="Search" />
                            <button className="btn btn-warning" type="submit"><i class="bi bi-search"></i></button>
                        </form>
                        <ul className="navbar-nav position-absolute top-50 end-0 translate-middle-y">
                        <li className="nav-item">
                            <a className="nav-link active" aria-current="page" href="#home">Home</a>
                        </li>
                        <li className="nav-item">
                            <a className="nav-link" href="#tours">Tours</a>
                        </li>
                        <li className="nav-item">
                            <a className="nav-link" href="#offers">Offers</a>
                            </li>
                            <li className="nav-item">
                                <a className="nav-link" href="#contact">Contact us</a>
                            </li>
                        <li className="nav-item">
                            <a className="nav-link" href="#about">About us</a>
                        </li>
                            
                    </ul>
                        
                    </div>
                </div>
            </nav>

            <div>
                <div>
                    <Slide easing="ease">
                        <div className="each-slide">
                            <div style={{ 'backgroundImage': `url(${slideImages[0]})` }}>
                                <span>Slide 1</span>
                            </div>
                        </div>
                        <div className="each-slide">
                            <div style={{ 'backgroundImage': `url(${slideImages[1]})` }}>
                                <span>Slide 2</span>
                            </div>
                        </div>
                        <div className="each-slide">
                            <div style={{ 'backgroundImage': `url(${slideImages[2]})` }}>
                                <span>Slide 3</span>
                            </div>
                        </div>
                    </Slide>
                </div>
            </div>

            
            <nav className="navbar navbar-expand navbar-dark bg-dark "></nav>
        
        </div>       
        );
   
}

export default Header;
